import { createApp } from 'vue'
import App from './App.vue'
import router from "./router";
import store from "./store/store";
import axios from "axios";

const app = createApp(App);
axios.defaults.baseURL = 'http://127.0.0.1:8000/api/v1';
app.use(router);
app.use(store)
app.mount('#app')
